import { CART_ADD_ITEM } from '../constant/Cartconstant'
export const cartReducer=(state={cartItems:[]},action)=>{
    switch(action.type){
        case CART_ADD_ITEM:
            // const item=action.payload
            return(cartItems:action.payload)
        default:
            return state
    }

}
